import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import { HomePage } from "./pages/HomePage";
import { NavBar } from "./pages/NavBar";
import { AboutPage } from "./pages/AboutPage";
import { LoginPage } from "./pages/LoginPage";
import { ContactPage } from "./pages/ContactPage";
import { SongsDirectory } from "./pages/SongsDirectory";
import { AddMember } from "./pages/AddMember";

function App() {
  return (
    <div className="App"> 
      <BrowserRouter>
        <NavBar />

        <Routes>
          <Route path="/" exact={true} element={<HomePage />} />  
          <Route path="/directorydice" exact={true} element={<HomePage />} />
          <Route path="/aboutus" exact={true} element={<AboutPage />} />
          <Route path="/contact" exact={true} element={<ContactPage />} />
          <Route path="/login" exact={true} element={<LoginPage />} />
          <Route path="/songsdirectory" exact={true} element={<SongsDirectory />} />
          <Route path="/addmember" exact={true} element={<AddMember />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
